import "./style.css";
import { Link } from "react-router-dom";
import React, { Component } from "react";
class Login extends Component {
  state = {};

  render() {
    return (
      <div style={style}>
        <p> This is Login page</p>
        <button>
          <Link to="/Game">click me to play</Link>
        </button>
      </div>
    );
  }
}
const style = {
  tacos: {
    style: "text-align:center",
  },
};
export default Login;
